import React, { useEffect, useState } from 'react'; // Asegúrate de importar React, useEffect y useState

function GetStudent({ sendName }) {
    const [prueba, setPrueba] = useState(""); // Declara una variable de estado para almacenar sendName
    
    useEffect(() => {
        setPrueba(sendName); // Actualiza el valor de prueba con sendName cuando cambie
    }, [sendName]);

    console.log(prueba);

    return (
        <div className="student-card">
                <ul className="student-info-list">
                  <li><strong>Prueba:</strong> {prueba}</li>
                </ul>
              </div>
    );
}

export default GetStudent;
